type TokensGetterMock struct {
	// TokensFunc mocks the Tokens method.
	TokensFunc func(namespace string) v3.TokenInterface

	// calls tracks calls to the methods.
	calls struct {
		// Tokens holds details about calls to the Tokens method.
		Tokens []struct {
			// Namespace is the namespace argument value.
			Namespace string
		}
	}
}

// Tokens calls TokensFunc.
func (mock *TokensGetterMock) Tokens(namespace string) v3.TokenInterface {
	if mock.TokensFunc == nil {
		panic("TokensGetterMock.TokensFunc: method is nil but TokensGetter.Tokens was just called")
	}
	callInfo := struct {
		Namespace string
	}{
		Namespace: namespace,
	}
	lockTokensGetterMockTokens.Lock()
	mock.calls.Tokens = append(mock.calls.Tokens, callInfo)
	lockTokensGetterMockTokens.Unlock()
	return mock.TokensFunc(namespace)
}

// TokensCalls gets all the calls that were made to Tokens.
// Check the length with:
//     len(mockedTokensGetter.TokensCalls())
func (mock *TokensGetterMock) TokensCalls() []struct {
	Namespace string
} {
	var calls []struct {
		Namespace string
	}
	lockTokensGetterMockTokens.RLock()
	calls = mock.calls.Tokens
	lockTokensGetterMockTokens.RUnlock()
	return calls
}
